description.Description:
Jam Base methods.
    plotSmoothScatter: smooth scatter plot with fine detail;
    imageDefault: rasterized image plots; imageByColors: data.frame to image;
    mixedSort: efficient alphanumeric sort;
    jargs: formatted, colored function arguments;
    rbindList: list to data.frame without filling empty cells;
    makeNames, nameVector: uniquely assign names to vectors

A collection of tests, data sets, and examples
 for diagnostic checking in linear regression models. Furthermore,
 some generic tools for inference in parametric models are provided.

